B.Fw=new A.fe("\xbfPor d\xf3nde comenzar?","Estar solo en el proceso suele ser dif\xedcil e intentar comprender la plataforma, cu\xe1nto presupuesto diario invertir, tener errores, estar inhabilitados, no saber si la estrategia funcionar\xe1 y c\xf3mo analizar los resultados suele ser un dolor de cabeza.\n\nEs por eso que esta asesor\xeda te ayudar\xe1 a obtener un panorama m\xe1s exacto de lo que necesitas y adem\xe1s acelerar el proceso que debes tener como negocio.\n\nCon mi experiencia en el mundo de la publicidad digital, puedo darte una visi\xf3n m\xe1s clara de lo que requieres para aumentar las ventas.\n\nDurante el 2021 comenc\xe9 a realizar estas asesor\xedas y he perfeccionado la metodolog\xeda para que puedas aprovechar este tiempo en aclarar todas tus dudas y solucionar esos errores comunes que hacen que no avances, corregirlos y dar en el punto de posicionar tu negocio.\n\nAl comprar el servicio te llegar\xe1 un correo con la informaci\xf3n que necesitas tener para ese d\xeda y podamos aprovechar la asesor\xeda al m\xe1ximo.",null)
B.Fy=new A.fe("\xbfQu\xe9 hablaremos en la reuni\xf3n?","Plan de negocio\nAnalizar\xe9 si tu propuesta te dar\xe1 rentabilidad con los servicios o productos que quieres comercializar por internet.\n\nCampa\xf1as\nCreadas o no creadas revisar\xe9 su estructura y estrategia de manera estrat\xe9gica.\n\nSitio Web\nExaminar\xe9 toda la estructura y te dar\xe9 la v\xeda para que puedas vender m\xe1s por tu web.\n\nM\xe9todo de Ventas\nDependiendo de la metodolog\xeda mejoraremos la manera en la que cierras con tus clientes.",null)
B.Fv=new A.fe("Preguntas frecuentes","\xbfImporta si no conozco nada de Facebook - Instagram o Tik Tok Ads?\nNo, m\xedralo como si fueran clases privadas solo para ti.\n\n\xbfSi conozco y hago campa\xf1as actualmente esto es para mi?\nS\xed, te har\xe9 un examen general de tu negocio y c\xf3mo puedes mejorar en los puntos en que est\xe9s fallando en ads.\n\n\xbfPuedo ver m\xe1s de 1 hora?\nPor supuesto, en caso de requerir m\xe1s clases al final de nuestro meeting podemos coordinar la hora y d\xeda de las siguientes, tendr\xe1s muchas tareas que te enviar\xe9, si eso sucede, prep\xe1rate para este reto.\n\n\xbfD\xf3nde ser\xe1 la video llamada?\nSer\xe1 a trav\xe9s de la plataforma Zoom.\n\n\xbfY si no estoy satisfecho con mi mentor\xeda?\nEn caso de que no sea lo que esperabas, te devolver\xe9 todo tu dinero.\n\n\xbfTuve un inconveniente, puedo reprogramar nuestra reuni\xf3n?\nTienes 24 horas a m\xe1s tardar para poder agendar otro d\xeda y hora, debes notificar en el siguiente correo: hola@jpdirector.net\n\nEn caso de que no lo hagas en ese tiempo perder\xe1s tu inversi\xf3n y pagar\xe1s nuevamente una nueva asesor\xeda.",null)
